INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みやこ", 0, 0, "ミヤコ（クリスマス）", 119901, 2.17, 119901, 14, 0, "2024/12/31 11:59:59", 3, 0, 0, 0, 1, 302, 1, 119901, 0, 119901, 450, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", "2024/12/22 12:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しずる", 0, 0, "シズル（ノワール）", 120001, 2.375, 120001, 6, 0, "2025/03/15 14:59:59", 3, 0, 0, 0, 5, 190, 1, 120001, 0, 120001, 450, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", "2025/03/10 12:00:00", 1, 5);
