INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しぇふぃ", 0, 0, "シェフィ（ニューイヤー）", 120701, 1.84, 120701, 1, 0, "2025/01/20 11:59:59", 3, 0, 0, 0, 4, 283, 1, 120701, 0, 120701, 450, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", "2025/01/15 15:00:00", 1, 22);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("るか", 0, 0, "ルカ（ニューイヤー）", 120801, 1.3, 120801, 2, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 4, 193, 1, 120801, 0, 120801, 450, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", "2023/10/16 15:00:00", 1, 22);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いりや", 0, 0, "イリヤ（ニューイヤー）", 120901, 1.425, 120901, 12, 0, "2025/01/20 11:59:59", 3, 0, 0, 0, 3, 424, 2, 120901, 0, 120901, 450, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", "2025/01/15 15:00:00", 1, 38);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぺこりーぬ", 0, 0, "ペコリーヌ（オーバーロード）", 121001, 2.25, 121001, 1, 0, "2025/02/24 11:59:59", 3, 0, 0, 0, 5, 164, 1, 121001, 0, 121001, 450, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", "2025/02/20 12:00:00", 1, 41);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きゃる", 0, 0, "キャル（オーバーロード）", 121101, 2.07, 121101, 1, 0, "2025/02/24 11:59:59", 3, 0, 0, 0, 7, 588, 2, 121101, 0, 121101, 450, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", "2025/02/20 12:00:00", 1, 42);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らびりすた", 0, 0, "ラビリスタ（オーバーロード）", 121201, 1.55, 121201, 6, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 4, 260, 1, 121201, 0, 121201, 450, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", "2023/11/16 15:00:00", 1, 40);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くるみ", 0, 0, "クルミ（ステージ）", 121301, 1.9, 121301, 3, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 3, 731, 1, 121301, 0, 121301, 450, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", "2022/03/03 19:00:00", 0, 3);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みさき", 0, 0, "ミサキ（ステージ）", 121401, 2.27, 121401, 15, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 742, 2, 121401, 0, 121401, 450, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", "2022/03/15 15:00:00", 0, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あゆみ", 0, 0, "アユミ（怪盗）", 121501, 2.0, 121501, 12, 0, "2025/04/30 11:59:59", 3, 0, 0, 0, 6, 590, 1, 121501, 0, 121501, 450, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", "2025/04/26 12:00:00", 1, 6);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いのり", 0, 0, "イノリ（怪盗）", 121601, 1.425, 121601, 17, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 3, 292, 1, 121601, 0, 121601, 450, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", "2022/04/15 15:00:00", 0, 3);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あきの", 0, 0, "アキノ（アキノ＆サレン）", 0, 0.0, 121701, 0, 0, "2030/12/31 15:00:00", 3, 1, 180901, 0, 0, 421, 0, 121701, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("されん", 0, 0, "サレン（アキノ＆サレン）", 0, 0.0, 121801, 0, 0, "2030/12/31 15:00:00", 3, 1, 180901, 0, 0, 421, 0, 121801, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あんな", 0, 0, "アンナ（パイレーツ）", 121901, 2.125, 121901, 12, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 5, 293, 2, 121901, 0, 121901, 450, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", "2022/05/15 15:00:00", 0, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しのぶ", 0, 0, "シノブ（パイレーツ）", 122001, 1.425, 122001, 14, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 3, 380, 1, 122001, 0, 122001, 450, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", "2022/05/03 19:00:00", 0, 3);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あおい", 0, 0, "アオイ（キャンプ）", 122101, 1.97, 122101, 9, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 35, 731, 1, 122101, 0, 122101, 450, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", "2024/04/18 15:00:00", 1, 35);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆかり", 0, 0, "ユカリ（キャンプ）", 122201, 1.84, 122201, 8, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 4, 419, 1, 122201, 0, 122201, 450, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", "2022/05/31 12:00:00", 0, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("うぁんぴぃ", 0, 0, "ヴァンピィ", 122301, 1.425, 122301, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 43, 564, 2, 122301, 0, 122301, 450, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", "2022/06/15 15:00:00", 0, 43);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ひより", 0, 0, "ヒヨリ（サマー）", 122401, 2.42, 122401, 8, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 1, 264, 1, 122401, 0, 122401, 450, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", "2024/06/17 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れい", 0, 0, "レイ（サマー）", 122501, 1.965, 122501, 0, 0, "2025/08/31 11:59:59", 3, 0, 0, 0, 4, 250, 1, 122501, 0, 122501, 450, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", "2025/08/22 12:00:00", 1, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆい", 0, 0, "ユイ（サマー）", 122601, 2.27, 122601, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 554, 2, 122601, 0, 122601, 450, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", "2022/07/15 15:00:00", 0, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きょうか", 0, 0, "キョウカ（サマー）", 122701, 1.92, 122701, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 812, 2, 122701, 0, 122701, 450, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", "2022/08/15 15:00:00", 0, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みそぎ", 0, 0, "ミソギ（サマー）", 122801, 2.295, 122801, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 1, 237, 1, 122801, 0, 122801, 450, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", "2024/07/16 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みみ", 0, 0, "ミミ（サマー）", 122901, 2.25, 122901, 0, 0, "2025/08/31 11:59:59", 3, 0, 0, 0, 5, 361, 1, 122901, 0, 122901, 450, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", "2025/08/22 12:00:00", 1, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あめす", 0, 0, "アメス", 123001, 2.27, 123001, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 44, 746, 2, 123001, 0, 123001, 450, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", "2025/10/31 12:00:00", 1, 44);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まほ", 0, 0, "マホ（エクスプローラー）", 123101, 1.795, 123101, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 793, 2, 123101, 0, 123101, 450, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", "2022/09/03 19:00:00", 0, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あやね", 0, 0, "アヤネ（エクスプローラー）", 123201, 1.425, 123201, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 3, 256, 1, 123201, 0, 123201, 450, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", "2022/09/15 15:00:00", 0, 3);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねあ", 0, 0, "ネア", 123301, 1.62, 123301, 0, 0, "2025/09/30 11:59:59", 3, 0, 0, 0, 1, 350, 1, 123301, 0, 123301, 450, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", "2025/09/16 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("じゅん", 0, 0, "ジュン（キャンプ）", 0, 0.0, 123401, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 5, 0, 0, 123401, 0, 0, 0, "", "2015/04/01 15:00:00", 0, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りん", 0, 0, "リン（ハロウィン）", 123501, 2.34, 123501, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 6, 583, 1, 123501, 0, 123501, 450, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", "2024/09/17 15:00:00", 1, 6);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("とも", 0, 0, "トモ（ハロウィン）", 123601, 1.965, 123601, 0, 0, "2024/10/28 11:59:59", 3, 0, 0, 0, 4, 262, 1, 123601, 0, 123601, 450, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", "2024/10/24 12:00:00", 1, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ななか", 0, 0, "ナナカ（ハロウィン）", 123701, 2.07, 123701, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 741, 2, 123701, 0, 123701, 450, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", "2022/10/15 15:00:00", 0, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりすてぃーな", 0, 0, "クリスティーナ（ワイルド）", 123801, 2.295, 123801, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 1, 238, 1, 123801, 0, 123801, 450, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", "2025/11/03 12:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まつり", 0, 0, "マツリ（ワイルド）", 123901, 2.125, 123901, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 2, 183, 1, 123901, 0, 123901, 450, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", "2022/11/15 15:00:00", 0, 2);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あかり", 0, 0, "アカリ（クリスマス）", 124001, 2.07, 124001, 0, 0, "2024/12/31 11:59:59", 3, 0, 0, 0, 7, 438, 2, 124001, 0, 124001, 450, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", "2024/12/22 12:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("より", 0, 0, "ヨリ（クリスマス）", 124101, 1.965, 124101, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 6, 433, 2, 124101, 0, 124101, 450, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", "2024/11/16 15:00:00", 1, 6);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("じゅん", 0, 0, "ジュン（クリスマス）", 124201, 2.07, 124201, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 5, 144, 1, 124201, 0, 124201, 450, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", "2022/12/23 12:00:00", 0, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あん", 0, 0, "アン（アン＆グレア）", 0, 0.0, 124301, 0, 0, "2030/12/31 15:00:00", 3, 1, 181001, 0, 0, 577, 0, 124301, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぐれあ", 0, 0, "グレア（アン＆グレア）", 0, 0.0, 124401, 0, 0, "2030/12/31 15:00:00", 3, 1, 181001, 0, 0, 577, 0, 124401, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ほまれ", 0, 0, "ホマレ（ニューイヤー）", 124501, 2.07, 124501, 0, 0, "2025/01/20 11:59:59", 3, 0, 0, 0, 7, 707, 2, 124501, 0, 124501, 450, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", "2025/01/15 15:00:00", 1, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みさと", 0, 0, "ミサト（ニューイヤー）", 124601, 2.44, 124601, 0, 0, "2025/01/20 11:59:59", 3, 0, 0, 0, 7, 698, 2, 124601, 0, 124601, 450, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", "2025/01/15 15:00:00", 1, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みつき", 0, 0, "ミツキ（ニューイヤー）", 124701, 2.24, 124701, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 7, 590, 1, 124701, 0, 124701, 450, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", "2024/12/16 15:00:00", 1, 46);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("のぞみ", 0, 0, "ノゾミ（リベレイター）", 124801, 2.14, 124801, 0, 0, "2025/02/24 11:59:59", 3, 0, 0, 0, 4, 423, 1, 124801, 0, 124801, 450, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", "2025/02/20 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かや", 0, 0, "カヤ（リベレイター）", 124901, 1.965, 124901, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 1, 170, 1, 124901, 0, 124901, 450, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", "2025/01/16 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("むいみ", 0, 0, "ムイミ（リベレイター）", 125001, 1.965, 125001, 0, 0, "2025/02/24 11:59:59", 3, 0, 0, 0, 5, 221, 1, 125001, 0, 125001, 450, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", "2025/02/20 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("たまき", 0, 0, "タマキ（カフェ）", 125101, 2.24, 125101, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 8, 825, 1, 125101, 0, 125101, 450, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", "2023/03/03 19:00:00", 0, 47);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("もにか", 0, 0, "モニカ（カフェ）", 125201, 1.965, 125201, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 4, 463, 1, 125201, 0, 125201, 450, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", "2023/03/10 12:00:00", 0, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("こっころ", 0, 0, "コッコロ（レンジャー）", 125301, 2.07, 125301, 0, 0, "2025/04/30 11:59:59", 3, 0, 0, 0, 6, 752, 1, 125301, 0, 125301, 450, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", "2025/04/26 12:00:00", 1, 6);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しおり", 0, 0, "シオリ（レンジャー）", 125401, 2.09, 125401, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 8, 710, 1, 125401, 0, 125401, 450, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", "2023/04/10 12:00:00", 0, 8);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("じーた", 0, 0, "ジータ（ウォーロック）", 125501, 1.92, 125501, 0, 0, "2025/05/31 11:59:59", 3, 0, 0, 0, 7, 443, 2, 125501, 0, 125501, 450, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", "2025/05/15 15:00:00", 1, 50);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("びから", 0, 0, "ビカラ", 125601, 2.09, 125601, 0, 0, "2025/05/31 11:59:59", 3, 0, 0, 0, 51, 267, 1, 125601, 0, 125601, 450, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", "2025/05/15 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かりん", 0, 0, "カリン（アルケミスト）", 125701, 2.24, 125701, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 7, 579, 2, 125701, 0, 125701, 450, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", "2025/04/16 15:00:00", 1, 9);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 0, 0, "リリ（フォールン）", 125801, 2.09, 125801, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 3, 464, 1, 125801, 0, 125801, 450, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", "2023/04/17 12:00:00", 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かや", 0, 0, "カヤ（リベレイター）", 0, 0.0, 125901, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 1, 0, 0, 125901, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりあ", 0, 0, "クリア（フォールン）", 126001, 2.09, 126001, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 0, 406, 1, 126001, 0, 126001, 450, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", "2023/10/31 12:00:00", 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぷれしあ", 0, 0, "プレシア（フォールン）", 126101, 2.09, 126101, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 44, 480, 2, 126101, 0, 126101, 450, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", "2023/11/15 15:00:00", 0, 53);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いりや", 0, 0, "イリヤ（儀装束）", 126201, 2.09, 126201, 0, 0, "2025/06/20 11:59:59", 3, 0, 0, 0, 3, 568, 2, 126201, 0, 126201, 450, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", "2025/06/10 12:00:00", 1, 3);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆき", 0, 0, "ユキ（儀装束）", 126301, 2.07, 126301, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 456, 2, 126301, 0, 126301, 450, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", "2023/06/15 15:00:00", 0, 9);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くろーちぇ", 0, 0, "クローチェ", 126401, 2.09, 126401, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 1, 373, 1, 126401, 0, 126401, 450, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", "2025/10/31 12:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らいらえる", 0, 0, "ライラエル", 126501, 1.965, 126501, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 7, 740, 2, 126501, 0, 126501, 450, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねねか", 0, 0, "ネネカ（サマー）", 126601, 2.04, 126601, 0, 0, "2025/08/15 14:59:59", 3, 0, 0, 0, 7, 650, 2, 126601, 0, 126601, 450, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", "2025/08/10 12:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あきの", 0, 0, "アキノ（サマー）", 126701, 1.965, 126701, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 5, 224, 1, 126701, 0, 126701, 450, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", "2025/06/17 15:00:00", 1, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆかり", 0, 0, "ユカリ（サマー）", 126801, 1.97, 126801, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 5, 159, 1, 126801, 0, 126801, 450, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", "2023/07/15 15:00:00", 0, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らんふぁ", 0, 0, "ランファ（サマー）", 126901, 1.965, 126901, 0, 0, "2025/08/31 11:59:59", 3, 0, 0, 0, 7, 682, 2, 126901, 0, 126901, 450, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", "2025/08/22 12:00:00", 1, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くうか", 0, 0, "クウカ（サマー）", 127001, 1.97, 127001, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 2, 133, 1, 127001, 0, 127001, 450, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", "2025/07/16 15:00:00", 1, 52);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しのぶ", 0, 0, "シノブ（サマー）", 127101, 2.09, 127101, 0, 0, "2025/08/31 11:59:59", 3, 0, 0, 0, 5, 255, 1, 127101, 0, 127101, 450, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", "2025/08/22 12:00:00", 1, 46);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きゃる", 0, 0, "キャル（編入生）", 127201, 2.09, 127201, 0, 0, "2025/09/30 11:59:59", 3, 0, 0, 0, 7, 804, 2, 127201, 0, 127201, 450, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", "2025/09/16 15:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("すずな", 0, 0, "スズナ（編入生）", 127301, 2.09, 127301, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 8, 750, 1, 127301, 0, 127301, 450, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", "2023/09/15 15:00:00", 0, 8);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("びから", 0, 0, "ビカラ（コラボ）", 0, 0.0, 127401, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 1, 0, 0, 127401, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("されん", 0, 0, "サレン（サラサリア）", 127501, 2.09, 127501, 0, 0, "2024/11/18 11:59:59", 3, 0, 0, 0, 4, 304, 1, 127501, 0, 127501, 450, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", "2024/11/11 12:00:00", 1, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("るか", 0, 0, "ルカ（サラサリア）", 127601, 1.965, 127601, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 4, 157, 1, 127601, 0, 127601, 450, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", "2023/10/15 15:00:00", 0, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りんど", 0, 0, "リンド", 127701, 1.965, 127701, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 6, 693, 2, 127701, 0, 127701, 450, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", "2024/10/10 12:00:00", 0, 48);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("うるむ", 0, 0, "ヴルム", 127801, 1.965, 127801, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 706, 2, 127801, 0, 127801, 450, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", "2024/10/18 12:00:00", 0, 47);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぺこりーぬ", 0, 0, "ペコリーヌ（クリスマス）", 127901, 1.965, 127901, 0, 0, "2024/12/15 14:59:59", 3, 0, 0, 0, 5, 372, 2, 127901, 0, 127901, 450, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", "2024/12/09 12:00:00", 1, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くれじった", 0, 0, "クレジッタ（クリスマス）", 128001, 2.09, 128001, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 35, 723, 1, 128001, 0, 128001, 450, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", "2023/12/15 15:00:00", 0, 35);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しずる", 0, 0, "シズル（シズル&リノ）", 0, 0.0, 128101, 0, 0, "2030/12/31 15:00:00", 3, 1, 181101, 0, 0, 580, 0, 128101, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りの", 0, 0, "リノ（シズル&リノ）", 0, 0.0, 128201, 0, 0, "2030/12/31 15:00:00", 3, 1, 181101, 0, 0, 580, 0, 128201, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いのり", 0, 0, "イノリ（ニューイヤー）", 128301, 2.09, 128301, 0, 0, "2030/12/31 15:00:00", 1, 1, 0, 0, 3, 191, 1, 128301, 0, 128301, 450, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", "2023/12/31 12:00:00", 1, 38);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("はつね", 0, 0, "ハツネ（ニューイヤー）", 128401, 2.09, 128401, 0, 0, "2025/01/15 14:59:59", 3, 0, 0, 0, 7, 801, 2, 128401, 0, 128401, 450, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", "2025/01/09 12:00:00", 1, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かすみ", 0, 0, "カスミ（ニューイヤー）", 128501, 2.09, 128501, 0, 0, "2025/01/15 14:59:59", 3, 0, 0, 0, 7, 739, 2, 128501, 0, 128501, 450, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", "2025/01/09 12:00:00", 1, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 0, 0, "リリ（フォールン）", 0, 0.0, 128601, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 1, 0, 0, 128601, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ひより", 0, 0, "ヒヨリ（アストラル）", 128701, 2.09, 128701, 0, 0, "2025/02/15 14:59:59", 3, 0, 0, 0, 1, 226, 1, 128701, 0, 128701, 450, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", "2025/02/10 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れい", 0, 0, "レイ（アストラル）", 128801, 1.965, 128801, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 4, 194, 1, 128801, 0, 128801, 450, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", "2025/08/16 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆい", 0, 0, "ユイ（アストラル）", 128901, 2.09, 128901, 0, 0, "2025/02/15 14:59:59", 3, 0, 0, 0, 7, 772, 2, 128901, 0, 128901, 450, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", "2025/02/10 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えりす", 0, 0, "エリス", 129001, 2.09, 129001, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 7, 800, 2, 129001, 0, 129001, 450, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆに", 0, 0, "ユニ（ウィンター）", 129301, 2.09, 129301, 0, 0, "2025/03/15 14:59:59", 3, 0, 0, 0, 7, 708, 1, 129301, 0, 129301, 450, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", "2025/03/10 12:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くろえ", 0, 0, "クロエ（ウィンター）", 129401, 2.09, 129401, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 2, 188, 1, 129401, 0, 129401, 450, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", "2024/03/18 12:00:00", 0, 2);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ちえる", 0, 0, "チエル（ウィンター）", 129501, 2.09, 129501, 0, 0, "2025/06/27 11:59:59", 3, 0, 0, 0, 1, 247, 1, 129501, 0, 129501, 450, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", "2025/06/20 12:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あねもね", 0, 0, "アネモネ", 129601, 2.09, 129601, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 0, 550, 1, 129601, 0, 129601, 450, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねふぃーねら", 0, 0, "ネフィ＝ネラ", 129701, 2.09, 129701, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 0, 540, 1, 129701, 0, 129701, 450, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まこと", 0, 0, "マコト（コマンダー）", 129801, 2.09, 129801, 0, 0, "2025/04/30 11:59:59", 3, 0, 0, 0, 5, 269, 1, 129801, 0, 129801, 450, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", "2025/04/26 12:00:00", 1, 5);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えりこ", 0, 0, "エリコ（コマンダー）", 129901, 1.84, 129901, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 6, 294, 1, 129901, 0, 129901, 450, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", "2024/04/15 15:00:00", 0, 48);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("やまと", 0, 0, "ヤマト", 130001, 2.09, 130001, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 4, 150, 1, 130001, 0, 130001, 450, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("わかな", 0, 0, "ワカナ", 130101, 2.09, 130101, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 7, 535, 1, 130101, 0, 130101, 450, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", "2025/11/03 12:00:00", 1, 9);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ふぶき", 0, 0, "フブキ", 130201, 1.84, 130201, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 5, 371, 1, 130201, 0, 130201, 450, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れい", 0, 0, "レイ（アストラル）", 0, 0.0, 130601, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 4, 0, 0, 130601, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きょうか", 0, 0, "キョウカ（スプリング）", 130701, 1.92, 130701, 0, 0, "2025/05/15 14:59:59", 3, 0, 0, 0, 7, 563, 2, 130701, 0, 130701, 450, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", "2025/05/03 19:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("すずめ", 0, 0, "スズメ（スプリング）", 130801, 1.84, 130801, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 558, 2, 130801, 0, 130801, 450, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", "2024/05/15 15:00:00", 0, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くるる", 0, 0, "クルル", 130901, 2.09, 130901, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 440, 2, 130901, 0, 130901, 450, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", "2024/06/15 15:00:00", 0, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まほ", 0, 0, "マホ（ドリームパーク）", 131001, 1.84, 131001, 0, 0, "2025/06/20 11:59:59", 3, 0, 0, 0, 7, 702, 2, 131001, 0, 131001, 450, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", "2025/06/10 12:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねあ", 0, 0, "ネア（サマー）", 131101, 2.09, 131101, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 2, 165, 1, 131101, 0, 131101, 450, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", "2024/06/30 12:00:00", 0, 52);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みそら", 0, 0, "ミソラ（サマー）", 131201, 2.09, 131201, 0, 0, "2025/07/23 11:59:59", 3, 0, 0, 0, 54, 753, 2, 131201, 0, 131201, 450, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", "2025/07/10 12:00:00", 1, 54);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 0, 0, "リリ", 0, 0.0, 131301, 0, 0, "2030/12/31 15:00:00", 3, 1, 0, 0, 1, 0, 0, 131301, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりあ", 0, 0, "クリア", 0, 0.0, 131401, 0, 0, "2030/12/31 15:00:00", 3, 1, 0, 0, 1, 0, 0, 131401, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぷれしあ", 0, 0, "プレシア", 0, 0.0, 131501, 0, 0, "2030/12/31 15:00:00", 3, 1, 0, 0, 1, 0, 0, 131501, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 0, 0, "リリ（サマー）", 131601, 1.92, 131601, 0, 0, "2025/07/23 11:59:59", 3, 0, 0, 0, 4, 399, 1, 131601, 0, 131601, 450, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", "2025/07/10 12:00:00", 1, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あめす", 0, 0, "アメス（サマー）", 131701, 1.92, 131701, 0, 0, "2025/08/15 14:59:59", 3, 0, 0, 0, 44, 743, 2, 131701, 0, 131701, 450, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", "2025/08/10 12:00:00", 1, 53);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ほまれ", 0, 0, "ホマレ（サマー）", 131801, 2.09, 131801, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 709, 2, 131801, 0, 131801, 450, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", "2024/08/15 15:00:00", 0, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えみりあ", 0, 0, "エミリア（サマー）", 131901, 2.09, 131901, 0, 0, "2030/12/31 15:00:00", 1, 1, 0, 1, 7, 725, 2, 131901, 0, 131901, 450, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", "2024/08/31 12:00:00", 1, 23);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えきどな", 0, 0, "エキドナ（サマー）", 132001, 2.09, 132001, 0, 0, "2025/10/24 11:59:59", 3, 0, 0, 1, 7, 775, 2, 132001, 0, 132001, 450, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", "2025/10/10 12:00:00", 1, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れむ", 0, 0, "レム（サマー）", 132101, 2.09, 132101, 0, 0, "2025/10/24 11:59:59", 3, 0, 0, 1, 13, 146, 1, 132101, 0, 132101, 450, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", "2025/10/10 12:00:00", 1, 24);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("のぞみ", 0, 0, "ノゾミ（アルケミスト）", 132201, 1.84, 132201, 0, 0, "2025/10/31 11:59:59", 3, 0, 0, 0, 7, 721, 2, 132201, 0, 132201, 450, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", "2025/10/24 12:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("るいずまりー", 0, 0, "ルイズマリー", 132301, 2.09, 132301, 0, 0, "2025/05/15 14:59:59", 3, 0, 0, 0, 7, 754, 2, 132301, 0, 132301, 450, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", "2025/05/03 19:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いろは", 0, 0, "イロハ", 132401, 2.09, 132401, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 5, 501, 1, 132401, 0, 132401, 450, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", "2025/06/20 12:00:00", 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("その", 0, 0, "ソノ", 132501, 2.09, 132501, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 636, 2, 132501, 0, 132501, 450, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", "2025/05/15 15:00:00", 0, 23);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らいらえる", 0, 0, "ライラエル（クリスマス）", 132801, 2.09, 132801, 0, 0, "2025/06/20 11:59:59", 3, 0, 0, 0, 7, 750, 2, 132801, 0, 132801, 450, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", "2025/06/10 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いお", 0, 0, "イオ（クリスマス）", 132901, 2.09, 132901, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 5, 748, 2, 132901, 0, 132901, 450, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", "2024/12/09 12:00:00", 0, 46);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぐれいす", 0, 0, "グレイス", 133001, 2.09, 133001, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 0, 234, 1, 133001, 0, 133001, 450, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("うぁいおれっと", 0, 0, "ヴァイオレット", 133101, 1.75, 133101, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 0, 154, 1, 133101, 0, 133101, 450, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("もにか", 0, 0, "モニカ（ニューイヤー）", 133201, 2.09, 133201, 0, 0, "2030/12/31 15:00:00", 1, 1, 0, 0, 4, 296, 1, 133201, 0, 133201, 450, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", "2024/12/31 12:00:00", 1, 22);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("されん", 0, 0, "サレン（ニューイヤー）", 133501, 2.09, 133501, 0, 0, "2025/07/23 11:59:59", 3, 0, 0, 0, 4, 718, 2, 133501, 0, 133501, 450, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", "2025/07/10 12:00:00", 1, 22);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("めどぅーさ", 0, 0, "メドゥーサ", 133601, 2.09, 133601, 0, 0, "2025/07/31 11:59:59", 3, 0, 0, 0, 0, 445, 1, 133601, 0, 133601, 450, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", "2025/07/23 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らびりすた", 0, 0, "ラビリスタ（アルファ）", 133701, 2.09, 133701, 0, 0, "2025/08/22 11:59:59", 3, 0, 0, 0, 8, 717, 2, 133701, 0, 133701, 450, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", "2025/08/15 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねねか", 0, 0, "ネネカ（アルファ）", 133801, 2.09, 133801, 0, 0, "2025/08/22 11:59:59", 3, 0, 0, 0, 7, 759, 2, 133801, 0, 133801, 450, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", "2025/08/15 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりすてぃーな", 0, 0, "クリスティーナ（アルファ）", 133901, 2.09, 133901, 0, 0, "2025/08/22 11:59:59", 3, 0, 0, 0, 6, 228, 1, 133901, 0, 133901, 450, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", "2025/08/15 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ふぃお", 0, 0, "フィオ", 134001, 2.09, 134001, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 0, 746, 2, 134001, 0, 134001, 450, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ふぶき", 0, 0, "フブキ", 0, 0.0, 134101, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 5, 0, 0, 134101, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らいらえる", 0, 0, "ライラエル（クリスマス）", 0, 0.0, 134201, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 0, 0, 134201, 0, 0, 0, "", "2015/04/01 15:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らんふぁ", 0, 0, "ランファ（儀装束）", 134301, 2.09, 134301, 0, 0, "2025/09/30 11:59:59", 3, 0, 0, 0, 7, 778, 2, 134301, 0, 134301, 450, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", "2025/09/16 15:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ちか", 0, 0, "チカ（儀装束）", 134401, 2.09, 134401, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 7, 773, 2, 134401, 0, 134401, 450, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", "2025/03/15 15:00:00", 0, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くろーちぇ", 0, 0, "クローチェ（エアリアル）", 134501, 2.09, 134501, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 0, 719, 2, 134501, 0, 134501, 450, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あおい", 0, 0, "アオイ（パイロット）", 134601, 2.09, 134601, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 35, 526, 1, 134601, 0, 134601, 450, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", "2025/11/03 12:00:00", 1, 35);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ほうおう", 0, 0, "ホウオウ", 134701, 2.09, 134701, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 7, 490, 1, 134701, 0, 134701, 450, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", "2025/11/03 12:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("つむぎ", 0, 0, "ツムギ（ジオ・ゲヘナ）", 134801, 1.84, 134801, 0, 0, "2025/06/10 11:59:59", 3, 0, 0, 0, 1, 485, 1, 134801, 0, 134801, 450, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", "2025/05/31 12:00:00", 1, 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かのん", 0, 0, "カノン", 134901, 2.09, 134901, 0, 0, "2025/06/20 11:59:59", 3, 0, 0, 0, 2, 196, 1, 134901, 0, 134901, 450, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", "2025/06/10 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えりす", 0, 0, "エリス（サマー）", 135001, 2.09, 135001, 0, 0, "2025/07/10 11:59:59", 3, 0, 0, 0, 7, 785, 2, 135001, 0, 135001, 450, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", "2025/06/30 12:00:00", 1, 21);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しぇふぃ", 0, 0, "シェフィ（サマー）", 135101, 2.09, 135101, 0, 0, "2025/07/23 11:59:59", 3, 0, 0, 0, 4, 143, 1, 135101, 0, 135101, 450, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", "2025/07/10 12:00:00", 1, 4);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぷれしあ", 0, 0, "プレシア（サマー）", 135201, 2.09, 135201, 0, 0, "2025/07/31 11:59:59", 3, 0, 0, 0, 7, 548, 2, 135201, 0, 135201, 450, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", "2025/07/23 12:00:00", 1, 7);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりあ", 0, 0, "クリア（サマー）", 135301, 2.09, 135301, 0, 0, "2025/08/10 11:59:59", 3, 0, 0, 0, 54, 413, 1, 135301, 0, 135301, 450, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", "2025/07/31 12:00:00", 1, 54);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あねもね", 0, 0, "アネモネ（サマー）", 135401, 2.09, 135401, 0, 0, "2025/08/15 14:59:59", 3, 0, 0, 0, 2, 553, 2, 135401, 0, 135401, 450, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", "2025/08/10 12:00:00", 1, 52);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あいら", 0, 0, "アイラ", 135501, 2.09, 135501, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 1, 213, 1, 135501, 0, 135501, 450, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しなつ", 0, 0, "シナツ", 135601, 0.4, 135601, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 4, 198, 1, 135601, 0, 135601, 450, "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ひより", 0, 0, "ヒヨリ（サラサリア）", 135701, 1.84, 135701, 0, 0, "2030/12/31 15:00:00", 3, 0, 0, 0, 1, 291, 1, 135701, 0, 135701, 450, "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", "2025/09/16 15:00:00", 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆきの", 0, 0, "ユキノ", 135801, 2.09, 135801, 0, 0, "2025/10/10 11:59:59", 3, 0, 0, 0, 7, 830, 2, 135801, 0, 135801, 450, "【魔法】後衛から、雪魄氷姿の三味を弾じる初心な雪女。\n多様なデバフ効果で敵を弱体化させ、最も魔防の低い敵の\n状態に応じて発生する追加効果で、冥府を真白に染める。", "2025/09/30 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("さつき", 0, 0, "サツキ", 135901, 1.84, 135901, 0, 0, "2025/10/24 11:59:59", 3, 0, 0, 0, 3, 219, 1, 135901, 0, 135901, 450, "【物理】前衛で、華奢な体躯に厚い仁義を宿す鬼のお嬢。\n攻防自己強化や行動不能無効化で豪胆に立ち続け、自分が\n呪詛状態の時に振るう追加攻撃で、怪力無双の力を示す。", "2025/10/10 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あらくね", 0, 0, "アラクネ", 136001, 2.09, 136001, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 0, 11, 732, 1, 136001, 0, 136001, 450, "【物理】後衛で、喪われた光を求めてもがく元『六凶』。\n敵のＵＢを遅延する【遮絶の操糸】や、味方単体のＵＢを\n連続発動可能にする【賦活の糸】を戦場に張り巡らせる。", "2025/10/31 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("さくら", 0, 0, "サクラ", 136101, 1.74, 136101, 0, 0, "2025/11/03 11:59:59", 3, 0, 0, 1, 0, 432, 1, 136101, 0, 136101, 450, "【物理】中衛で不運に抗い歌い続けるゾンビィアイドル。\n一度倒れても立ち上がり、ＴＰを糧に強化されるスキルの\nダメージと味方の支援で、サガの心をアストルムに刻む。", "2025/10/24 12:00:00", 1, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("なーな", 0, 0, "ナーナ", 0, 0.0, 136201, 0, 0, "2030/12/31 15:00:00", 1, 0, 0, 0, 0, 0, 1, 136201, 0, 0, 0, "", "2015/04/01 15:00:00", 0, 1);
