INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かすみ", 0, 0, "カスミ（シスター）", 137401, 2.09, 137401, 0, 0, "2025/11/14 14:59:59", 3, 0, 0, 0, 7, 688, 2, 137401, 0, 137401, 450, "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", "2025/11/03 12:00:00", 1, 21);
